BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "generic_ballot_polls" (
	"question_id"	INTEGER,
	"poll_id"	INTEGER,
	"cycle"	INTEGER,
	"state"	TEXT,
	"pollster_id"	INTEGER,
	"pollster"	TEXT,
	"sponsor_ids"	TEXT,
	"sponsors"	TEXT,
	"partisan"	TEXT,
	"display_name"	TEXT,
	"pollster_rating_id"	INTEGER,
	"pollster_rating_name"	TEXT,
	"fte_grade"	TEXT,
	"sample_size"	INTEGER,
	"population"	TEXT,
	"population_full"	TEXT,
	"methodology"	TEXT,
	"office_type"	TEXT,
	"seat_number"	TEXT,
	"start_date"	TEXT,
	"end_date"	TEXT,
	"sponsor_candidate"	TEXT,
	"tracking"	TEXT,
	"nationwide_batch"	TEXT,
	"created_at"	TEXT,
	"notes"	TEXT,
	"url"	TEXT,
	"stage"	TEXT,
	"dem"	REAL,
	"rep"	REAL,
	"ind"	TEXT
);
CREATE TABLE IF NOT EXISTS "PollMethod" (
	"PollMethodID"	INTEGER,
	"PollMethod"	TEXT UNIQUE,
	PRIMARY KEY("PollMethodID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Sample" (
	"SampleID"	INTEGER,
	"SampleSize"	INTEGER,
	"PopulaitonID"	INTEGER,
	"PollMethoID"	INTEGER,
	"StartDate"	TEXT,
	"EndDate"	TEXT,
	"Tracking"	BLOB COLLATE BINARY,
	"DemPercent"	TEXT,
	"RepPercent"	TEXT,
	"IndPercent"	TEXT,
	"PollsterID"	INTEGER,
	FOREIGN KEY("PopulaitonID") REFERENCES "Population"("PopulationID"),
	FOREIGN KEY("PollMethoID") REFERENCES "PollMethod"("PollMethodID"),
	PRIMARY KEY("SampleID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Pollster" (
	"PollsterID"	INTEGER UNIQUE,
	"PollsterName"	TEXT,
	"PartisanLeaning"	TEXT,
	PRIMARY KEY("PollsterID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Population" (
	"PopulationID"	INTEGER,
	"Population"	TEXT NOT NULL UNIQUE,
	"Description"	TEXT,
	PRIMARY KEY("PopulationID")
);
COMMIT;
